def get_data(stocks_symbols, start):
  portafolio = pd.DataFrame()
  for i, stock in enumerate(stocks_symbols):
    portafolio[stock] = yf.Ticker(stock).history(period="max")["Close"].sort_index().loc[start:]
  return portafolio

